import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { X, Star, Zap, Trophy, RefreshCw } from 'lucide-react';

const SecretPage = ({ isOpen, onClose }) => {
  const [score, setScore] = useState(0);
  const [gameActive, setGameActive] = useState(false);
  const [targets, setTargets] = useState([]);
  const [timeLeft, setTimeLeft] = useState(30);
  const [gameOver, setGameOver] = useState(false);

  // Generate random targets for the mini-game
  const generateTarget = () => {
    return {
      id: Math.random(),
      x: Math.random() * 80 + 10, // 10% to 90% of container width
      y: Math.random() * 70 + 15, // 15% to 85% of container height
      size: Math.random() * 30 + 20, // 20px to 50px
      color: `hsl(${Math.random() * 360}, 70%, 60%)`
    };
  };

  // Start the game
  const startGame = () => {
    setScore(0);
    setTimeLeft(30);
    setGameActive(true);
    setGameOver(false);
    setTargets([generateTarget()]);
  };

  // Hit a target
  const hitTarget = (targetId) => {
    setTargets(targets.filter(t => t.id !== targetId));
    setScore(score + 10);

    // Add new target
    if (Math.random() > 0.3) {
      setTargets(prev => [...prev.filter(t => t.id !== targetId), generateTarget()]);
    }
  };

  // Game timer
  useEffect(() => {
    if (gameActive && timeLeft > 0) {
      const timer = setTimeout(() => setTimeLeft(timeLeft - 1), 1000);
      return () => clearTimeout(timer);
    } else if (timeLeft === 0) {
      setGameActive(false);
      setGameOver(true);
      setTargets([]);
    }
  }, [gameActive, timeLeft]);

  // Add targets periodically during game
  useEffect(() => {
    if (gameActive) {
      const interval = setInterval(() => {
        if (targets.length < 3) {
          setTargets(prev => [...prev, generateTarget()]);
        }
      }, 2000);
      return () => clearInterval(interval);
    }
  }, [gameActive, targets.length]);

  return (
    <AnimatePresence>
      {isOpen && (
        <motion.div
          className="fixed inset-0 z-50 flex items-center justify-center"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          exit={{ opacity: 0 }}
          style={{
            background: 'linear-gradient(135deg, #0f0f23 0%, #1a1a2e 50%, #16213e 100%)',
          }}
        >
          {/* Starfield Background */}
          <div className="absolute inset-0 overflow-hidden">
            {[...Array(50)].map((_, i) => (
              <motion.div
                key={i}
                className="absolute bg-white rounded-full"
                style={{
                  width: Math.random() * 3 + 1,
                  height: Math.random() * 3 + 1,
                  left: `${Math.random() * 100}%`,
                  top: `${Math.random() * 100}%`,
                }}
                animate={{
                  opacity: [0.3, 1, 0.3],
                  scale: [0.8, 1.2, 0.8],
                }}
                transition={{
                  duration: Math.random() * 3 + 2,
                  repeat: Infinity,
                  delay: Math.random() * 2,
                }}
              />
            ))}
          </div>

          {/* Main Game Container */}
          <motion.div
            className="relative w-full max-w-4xl h-5/6 mx-4"
            initial={{ scale: 0.8, y: 50 }}
            animate={{ scale: 1, y: 0 }}
            exit={{ scale: 0.8, y: 50 }}
            style={{
              background: 'rgba(255, 255, 255, 0.05)',
              border: '2px solid rgba(255, 255, 255, 0.3)',
              borderRadius: '12px',
              backdropFilter: 'blur(10px)',
              boxShadow: '0 0 40px rgba(0, 255, 255, 0.3)',
            }}
          >
            {/* Close Button */}
            <button
              onClick={onClose}
              className="absolute top-4 right-4 z-10 p-2 rounded-full bg-red-500/20 hover:bg-red-500/40 transition-colors"
            >
              <X size={24} className="text-white" />
            </button>

            {/* Header */}
            <div className="p-6 border-b border-white/20">
              <motion.h1
                className="text-4xl font-bold text-center bg-gradient-to-r from-cyan-400 to-purple-400 bg-clip-text text-transparent"
                animate={{
                  textShadow: [
                    '0 0 20px rgba(0, 255, 255, 0.5)',
                    '0 0 40px rgba(255, 0, 255, 0.5)',
                    '0 0 20px rgba(0, 255, 255, 0.5)',
                  ],
                }}
                transition={{ duration: 2, repeat: Infinity }}
              >
                ðŸŽ¯ PIXEL HUNTER ðŸŽ¯
              </motion.h1>
              <p className="text-center text-gray-300 mt-2">
                Click the glowing targets before time runs out!
              </p>
            </div>

            {/* Game Stats */}
            <div className="flex justify-between items-center p-4 border-b border-white/10">
              <div className="flex items-center space-x-4">
                <div className="flex items-center space-x-2">
                  <Star className="text-yellow-400" size={20} />
                  <span className="text-white font-mono text-lg">Score: {score}</span>
                </div>
                <div className="flex items-center space-x-2">
                  <Zap className="text-orange-400" size={20} />
                  <span className="text-white font-mono text-lg">Time: {timeLeft}s</span>
                </div>
              </div>

              {!gameActive && !gameOver && (
                <motion.button
                  onClick={startGame}
                  className="px-6 py-2 bg-green-500 hover:bg-green-600 text-white rounded-lg font-bold transition-colors"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  START GAME
                </motion.button>
              )}

              {gameOver && (
                <motion.button
                  onClick={startGame}
                  className="px-6 py-2 bg-blue-500 hover:bg-blue-600 text-white rounded-lg font-bold transition-colors flex items-center space-x-2"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  <RefreshCw size={16} />
                  <span>PLAY AGAIN</span>
                </motion.button>
              )}
            </div>

            {/* Game Area */}
            <div className="relative flex-1 p-4 overflow-hidden" style={{ height: 'calc(100% - 200px)' }}>
              {/* Game Over Screen */}
              {gameOver && (
                <motion.div
                  className="absolute inset-4 flex flex-col items-center justify-center bg-black/50 rounded-lg backdrop-blur-sm"
                  initial={{ opacity: 0, scale: 0.8 }}
                  animate={{ opacity: 1, scale: 1 }}
                >
                  <Trophy className="text-yellow-400 mb-4" size={64} />
                  <h2 className="text-3xl font-bold text-white mb-2">Game Over!</h2>
                  <p className="text-xl text-gray-300 mb-4">Final Score: {score}</p>
                  <p className="text-lg text-gray-400">
                    {score >= 200 ? "ðŸ† LEGENDARY!" : 
                     score >= 150 ? "ðŸ¥‡ AMAZING!" :
                     score >= 100 ? "ðŸ¥ˆ GREAT JOB!" :
                     score >= 50 ? "ðŸ¥‰ NOT BAD!" : "ðŸ’ª KEEP PRACTICING!"}
                  </p>
                </motion.div>
              )}

              {/* Targets */}
              <AnimatePresence>
                {targets.map((target) => (
                  <motion.button
                    key={target.id}
                    className="absolute rounded-full cursor-pointer border-2 border-white/50"
                    style={{
                      left: `${target.x}%`,
                      top: `${target.y}%`,
                      width: target.size,
                      height: target.size,
                      background: `radial-gradient(circle, ${target.color}, transparent)`,
                      boxShadow: `0 0 20px ${target.color}`,
                    }}
                    initial={{ scale: 0, opacity: 0 }}
                    animate={{ 
                      scale: [0, 1.2, 1],
                      opacity: [0, 1, 0.8],
                      boxShadow: [
                        `0 0 10px ${target.color}`,
                        `0 0 30px ${target.color}`,
                        `0 0 20px ${target.color}`,
                      ],
                    }}
                    exit={{ scale: 0, opacity: 0 }}
                    transition={{ duration: 0.3 }}
                    onClick={() => hitTarget(target.id)}
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.9 }}
                  />
                ))}
              </AnimatePresence>

              {/* Instructions */}
              {!gameActive && !gameOver && (
                <div className="absolute inset-4 flex items-center justify-center">
                  <div className="text-center text-gray-300">
                    <motion.div
                      animate={{ y: [0, -10, 0] }}
                      transition={{ duration: 2, repeat: Infinity }}
                    >
                      <Zap className="mx-auto mb-4 text-cyan-400" size={48} />
                    </motion.div>
                    <h3 className="text-2xl font-bold mb-4">Ready to Hunt?</h3>
                    <p className="text-lg">Click the START GAME button to begin!</p>
                    <p className="text-sm mt-2 opacity-75">Hit as many glowing targets as you can in 30 seconds</p>
                  </div>
                </div>
              )}
            </div>
          </motion.div>
        </motion.div>
      )}
    </AnimatePresence>
  );
};

export default SecretPage;
